import React from 'react'

class Player extends React.Component {
    render() {
        return (
            <div className="Player">
                <div>
                    {this.props.playerName}
                </div>
                <div>
                    {this.props.totalScore}
                </div>
                <div>
                    {this.props.currentRoll}
                </div>
            </div>
        )
    }
}

export default Player;
